import React from 'react';
import Footer from '../UI/Footer';
import NavBar from '../UI/NavBar';

const Login = () => {
  return (
    <div>
      <NavBar />
      <h1>Login Page</h1>
      <Footer />
    </div>
  );
};

export default Login;
